function mostrarMapa(coordenadas) {
  coordenadas = coordenadas.split(",");
  var latitude = parseFloat(coordenadas[0]);
  var longitude = parseFloat(coordenadas[1]);
  var coordenadasLatLng = new google.maps.LatLng(latitude, longitude);
  var mapa = new google.maps.Map(document.getElementById('mapa'), {
    zoom: 14,
    center: coordenadasLatLng
  });
  var marcador = new google.maps.Marker({
    position: coordenadasLatLng,
    map: mapa
  });
}
